import ifDefined from '@ui5/webcomponents-base/dist/renderer/ifDefined.js';
import { html, svg, repeat, classMap, styleMap } from '@ui5/webcomponents-base/dist/renderer/LitRenderer.js';
const block0 = (context) => { return html`${ context._isPhone ? block1(context) : block5(context) }`; };
const block1 = (context) => { return html`<ui5-dialog		?with-padding=${context.withPadding}		stretch		_disable-initial-focus		@ui5-beforeOpen="${ifDefined(context._propagateDialogEvent)}"		@ui5-afterOpen="${ifDefined(context._afterDialogOpen)}"		@ui5-beforeClose="${ifDefined(context._propagateDialogEvent)}"		@ui5-afterClose="${ifDefined(context._afterDialogClose)}"	>		${ !context._hideHeader ? block2(context) : undefined }<slot></slot>		<slot slot="footer" name="footer"></slot></ui5-dialog>`; };
const block2 = (context) => { return html`${ context.header.length ? block3(context) : block4(context) }`; };
const block3 = (context) => { return html`<slot slot="header" name="header"></slot>			`; };
const block4 = (context) => { return html`<header class="ui5-responsive-popover-header"><ui5-title level="H5" class="ui5-responsive-popover-header-text">${ifDefined(context.headerText)}</ui5-title><ui5-button						icon="decline"						design="Transparent"						@click="${context.close}"					></ui5-button></header>			`; };
const block5 = (context) => { return html`<div class="ui5-popover-root" role="dialog" aria-modal="true" aria-labelledby="ui5-popover-header" style=${styleMap(context.styles.root)}><span class="first-fe" tabindex="0" @focusin=${context.forwardToLast}></span><span class="ui5-popover-arr" style="${styleMap(context.styles.arrow)}"></span>	${ context._displayHeader ? block6(context) : undefined }<div class="ui5-popover-content" style=${styleMap(context.styles.content)}><slot></slot></div>	${ context._displayFooter ? block9(context) : undefined }<span class="last-fe" tabindex="0" @focusin=${context.forwardToFirst}></span></div>`; };
const block6 = (context) => { return html`${ context.header.length ? block7(context) : block8(context) }`; };
const block7 = (context) => { return html`<div class="ui5-popover-header-root" id="ui5-popover-header" role="toolbar"><slot name="header"></slot></div>		`; };
const block8 = (context) => { return html`<h2 class="ui5-popup-header-text" id="ui5-popover-header">${ifDefined(context.headerText)}</h2>		`; };
const block9 = (context) => { return html`${ context.footer.length ? block10(context) : undefined }`; };
const block10 = (context) => { return html`<div class="ui5-popover-footer-root" role="toolbar"><slot name="footer"></slot></div>		`; };

export default block0;
